import React from 'react'
import pizzas from "../../pizzasdata.js"
import Pizza from '../Pizza.js'

const Homescreen = () => {
    return (
        <div>
            <div className="row">
                {pizzas.map(pizzas => {
                    return <div className="col-md-4">
                        <div>
                            <Pizza pizza={pizzas} />
                        </div>
                    </div>
                })}
            </div>
        </div>
    )
}

export default Homescreen
